import java.util.*;import java.io.*;class compare{	public static void main(String args[]){		Set<String> s=new HashSet<>();		s.add("nitish");		s.add("naman");		System.out.print("Set1 :");		System.out.println(s);		Set<String> s1=new HashSet<>();		s1.add("ayush");		s1.add("nalin");		s1.add("naman");		s1.add("nitish");		System.out.print("Set2: ");		System.out.println(s1);		s1.retainAll(s);		System.out.print("common in both sets:");		System.out.println(s1);	}}